  ]);

  return (
    <div className="container">
      <h1>Note your tasks</h1>
      <div className="input-field">
        <input type="text" className="text" />
        <lable>Task name</lable>
      </div>
      <List tasks={tasks} />
    </div>
  );
}
export default Main;
